import React from 'react'
import './TimetableItemStyles.scss'

const TimetableItem = ({lesson,homework}) => (
    <div>
        <h1 className="lesson">
            {
                homework.map((item)=>(
                    <div className='homework-container'>
                        <h3 className='homework-component'>{item.info}</h3>
                        <h3 className="due-date">{item.duedate}</h3>
                    </div>
                ))
            }
        </h1>
    </div>
);

export default TimetableItem;
